import 'package:fish_redux/fish_redux.dart';import 'action.dart';import 'state.dart';Reducer<MainState> buildReducer() {  return asReducer(    <Object, Reducer<MainState>>{      MainAction.action: _onAction,      MainAction.tabChanged: _onTabChanged,    },  );}MainState _onAction(MainState state, Action action) {  final MainState newState = state.clone();  return newState;}MainState _onTabChanged(MainState state , Action action){  final int newIndex = action.payload ??0;  final MainState  newState = state.clone();  newState.selectedIndex = newIndex;  return newState;}